export function sequence(name: string, ...steps: Step[]): Result<any, any> {
  return new RootTaskStore((tasks) => ({
    name: name,
    action: async (ui, input) => {
      let prevResult = input

      // TODO: ui.onProgress can track here
      for (const task of tasks) {
        prevResult = await task.request.fetch(prevResult)
      }

      return prevResult
    },
  }), steps)
}